import React from "react";
import styled from 'styled-components';

export const HeaderContainer = styled.div`
  background: linear-gradient(
      90deg,
      #050d1eb2 0%,
      #050d1e29 40%,
      transparent 50%
    ),
  height: 46vw;
  width: 100vw;
`;
